function sec_sorteos(){
	if(sec_id=="sorteos" && sub_sec_id == ""){
		sec_sorteos_events();
	}
}

function sec_sorteos_events(){

	populateInput($('#txtSorteosTickets'));
	blockTyping($('#txtSorteosDNI'));

	setInterval(function() {
		$('[id=txtSorteosTickets]').each(function(){
			if(!$(this).val().match(/^\d{9,}$/)){
				$(this).val("");
			}
		});

		if($('#txtSorteosDNI').val().match(/^\d{8}$/)){
			$('#txtSorteosDNI').prop("readonly", "readonly");

			if($('#txtSorteosTickets').prop("disabled") == true){
				$('[id=txtSorteosTickets]').prop("disabled", false);
			}
		}
		else {
			$('#txtSorteosDNI').val("");
			$('[id=txtSorteosTickets]').prop("disabled", true);
		}
	}, 400);

	$('#txtSorteosPhone').on('keyup', function(event) {
		if(event.which == 13){
			$('#txtSorteosTickets').focus();
		}
	});

	$('#txtSorteosDNI').on('keyup', function(event) {
		if(event.which == 13 && $('#txtSorteosDNI').val().match(/^\d{8}$/)){
			$('#txtSorteosPhone').focus();
		}
	});

	$('#btnSorteosSend').on('click', function(event) {
		event.preventDefault();
		// genPDF();

		var data = {};
		data.dni = $('#txtSorteosDNI').val();
		data.phone = $('#txtSorteosPhone').val();
		data.tickets = $("[id='txtSorteosTickets'].acceptedInput").map(function(){ return $(this).val(); }).get();

		console.log(data);
		loading(true);
		auditoria_send({"proceso":"sorteos_process_tickets","data":data});
		$.post('/sys/get_sorteos.php', {"process_tickets": data}, function(response) {
			response = JSON.parse(response);
			auditoria_send({"proceso":"sorteos_process_tickets_response","data":response});
			genPDF(response.message[0]);
			loading();
		});
	});

}

function populateInput(obj){
	obj.on('keyup', function(event) {
		$(this).val($(this).val().replace(/[^\d]/g, ""));

		if(event.which === 13 && !$(this).prop("readonly")){
			if($(this).val()){
				var newObj = $(this).parents('#inputGroupSorteosTickets').clone();

				$('#blockSorteosTickets').append(newObj).html();
				newObj.find("#txtSorteosTickets").val("").focus();

				populateInput(newObj.find("#txtSorteosTickets"));

				var data = {};
				data.ticket = obj.val();
				data.dni = $('#txtSorteosDNI').val();

				auditoria_send({"proceso":"sorteos_get_ticket","data":data});
				$.post('/sys/get_sorteos.php', {"get_ticket": data}, function(response) {
					response = JSON.parse(response);
					auditoria_send({"proceso":"sorteos_get_ticket_response","data":response});

					if(response.code == 200) {
						obj.parents('#inputGroupSorteosTickets').find("#icoSorteosTickets").addClass('glyphicon-ok');
						obj.parents('#inputGroupSorteosTickets').addClass('has-success');

						if($('#btnSorteosSend').prop('disabled') && $('#txtSorteosPhone').val().length && $('#txtSorteosDNI').val().length){
							$('#btnSorteosSend').prop('disabled', false);
						}
						obj.addClass('acceptedInput');
					}
					else {
						obj.parents('#inputGroupSorteosTickets').find("#icoSorteosTickets").addClass('glyphicon-remove');
						obj.parents('#inputGroupSorteosTickets').addClass('has-error');
						obj.parents('#inputGroupSorteosTickets').tooltip({
							title: response.message,
							placement: 'right',
							trigger: 'manual'
						}).tooltip("show");
					}
					obj.prop("readonly", "readonly");
				});
			} else if(!$('#btnSorteosSend').prop("disabled")){
				$('#btnSorteosSend').click();
			}
		}
	});

	blockTyping(obj);
}

function blockTyping(obj){
	obj.on("cut paste",function(e) {
		e.preventDefault();
	});

	obj.on("contextmenu",function(e){
        return false;
    });

    obj.on("drop",function(e){
        return false;
    });
}

function genPDF(resp){
	var obj = {};

	obj.dni = resp['dni'];
	obj.tel = resp['phone'];
	obj.opc_acu = resp['OpcAcu'];
	obj.total = resp['total'];

	var imgData = imgCabecera;
	var doc = new jsPDF('p', 'mm', [80*2.83,80*2.83]);
		doc.setFontSize(7)
		doc.addImage(imgData, 'PNG', 6, 0, 60, 15);

        doc.setFontType("bold")
        doc.text(6,18,'DNI:')
        doc.setFontType("normal")
        doc.text(30,18,''+obj.dni+'')

		doc.setFontType("bold")
		doc.text(6,21,'Telf.:')
		doc.setFontType("normal")
		doc.text(30,21,''+obj.tel+'')

		doc.setFontType("bold")
		doc.text(6,24,'Opc. Agregadas:')
		doc.setFontType("normal")
		doc.text(30,24,''+obj.opc_acu+'')

		doc.setFontType("bold")
		doc.text(6,27,'Total de Opciones:')
		doc.setFontType("normal")
		doc.text(30,27,''+obj.total+'')

		doc.addImage(imgFooter, 'PNG', 6, 27, 60, 12);

		doc.autoPrint();
		window.open(doc.output('bloburl'), '_blank');

		window.location.href = "/?&sec_id=sorteos";
};


var imgCabecera = 'data:image/png;base64,';


var imgFooter = 'data:image/png;base64,';
